drop table if exists player;

Create table player (
  id int AUTO_INCREMENT PRIMARY KEY,
	first_name VARCHAR(100) not null,
	last_name VARCHAR(100) not null,
	rank_player int unsigned not null,
	team VARCHAR(100) not null,
	total_pts float not null,
	games_played tinyint(5) unsigned not null,
	rush_yards int,
  rush_tds int unsigned,
  pass_yards int,
  pass_tds int unsigned,
  fumbles int unsigned,
  interceptions int unsigned,
  position VARCHAR(3) not null,
  rec_yards int,
  rec int
);

